import React from 'react';
import Link from "next/link";

const CsCenter = () => {
    return (
        <>
            <section className={"csCenterMain max-width"}>
                <figure>
                    <img src="../images/kakao-phone.png" alt="카카오톡 채널"/>
                    <Link href="https://pf.kakao.com/_DRPiK">
                        <a>
                            <img src="../images/kakao-pardus.png" alt="카카오톡 채널 바로가기"/>
                        </a>
                    </Link>
                </figure>
            </section>
        </>
    )
}

export default CsCenter;
